import React from "react";
import request from 'superagent';
import DatePicker from "react-datepicker";
import "react-datepicker/dist/react-datepicker.css";
import { BrowserRouter as Router, Route, Link } from 'react-router-dom'

export default class Category extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      categorys: []
    };

    request
        .get('http://localhost:4000/categorys')
        .end((err, res) => {
            var categorys = res.body;
            this.setState({ categorys });
        });
  }

  render() {
    return (
      <div>
        <Link to="/category">Cansel</Link>
        <form onSubmit={this.handleSubmit}>
          <label>
            CategoryTitle:
            <input type="text" id="title" name="title" value={this.state.title} onChange={this.taskTitleChange} />
          </label>
          <input type="submit" value="変更" />
        </form>
      </div>
    );
    document.getElementById('calendar-button')
  }
};
